Of particular note is also the propensity for the accumulation of metabolites with multiple acetylations (reactions that do not lead toward Taxol) with a large number of possible combinations, including C- 7/C-9/C-10 (as in taxuspinanane K (
Morita et al., 1998a
)), C-9/C-10/C-13 (as in 9α,10β,13α- acetoxytaxa-4(20),11-dien-5α- ol (
Yang et al., 1996
)), C-2/C-5/C-9/C-10 (as in taxinine H (
Chiang et al., 1967
)), C-2/C-7/C-9/C-10 (as in taxuspine F (
Kobayashi et al., 1995a
)). C-2/C-9/C-10/C-13 (as in decinnamoyltaxinine E (
Chen et al., 1999
)), C-2/C-7/C-9/C-10/C-13 (as in decinnamoyltaxinine J (
