3,11-Cyclotaxanes constitute a subclass of taxanes in which a 6/8/6 normal taxane core is modified by the addition of a trans-annular 3,11 bond (
Table 21
). All metabolites feature a C-13 carbonyl group and a 4 (20)-double bond. The stereochemistry is predominantly 1β, 2α, 5α, 7β, 9α, 10β; only one exception has been reported thus far: 2α,7α,10β- triacetoxy-5α- cinnamoyloxy-9α- hydroxy-3,11-cyclotax-4(20)-en-13-one, which has a 7α- substituent (
